package cn.npnt.tiaps.assemble.vo;import java.util.List;import cn.npnt.tiaps.vo.LookVoteVO;public class VoteDataBody {	/**	 * lookId	 */	private Long id;	/**	 * 仲裁状态值 -1 ：等待仲裁 0：都不喜欢 0以上表示喜欢look的第几行	 */	private String verdict;	/**	 * 一个look里面的投票情况	 */	private List<LookVoteVO> votes;		public String getVerdict() {		return verdict;	}	public void setVerdict(String verdict) {		this.verdict = verdict;	}	public List<LookVoteVO> getVotes() {		return votes;	}	public void setVotes(List<LookVoteVO> votes) {		this.votes = votes;	}	public VoteDataBody(){			}	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}}